import React from 'react'

function RenderingLists() {
    const booklist = [
        'book1',
        'book2',
        'book3'
    ]

    const books = [
        {
            title: 'book1',
            aut: 'kkk',
            pages: 99
            },
        {
            title: 'book2',
            aut: 'mmmm',
            pages: 99
            },
        {
            title: 'book3',
            aut: 'jjj',
            pages: 99
            },
    ]
    return (
        <div>
            {booklist.map(book => {
                return <h2>Book</h2>
            }) }
            {books.map(book => {
                return <div>
                    <h1>book.title</h1>
                    <p>Book.aut</p>
                </div>
            })}
        </div>

    )
}

export default RenderingLists
